      'Create new library?' => 'Створити нову бібліотеку?',
      'Name of a concrete subclass of `%s` which tunes the analysis of `%s` statements for this linter.' => 'Назва конкретного підкласу `%s`, який налаштовує аналіз операторів `%s` для цього linter\'a.',
      'Night has fallen, and the thin sliver of moon overhead offers no comfort. It is almost pitch black. The night is bitter cold. It will be difficult to look around in these conditions.' => 'Настала ніч, і тонкий серпик місяця над головою не дає комфорту. Він майже чорний, як смола. Ніч дуже холодна. У таких умовах буде складно роззиратися довкола.',
      '**version**' => '**версія**',
      'Broken' => 'Зламано',
      'Server to connect to.' => 'Сервер для підключення.',
      'Created a new Differential revision:' => 'Створено нову Диференціальну версію:',
      'When creating a revision, try to use the working copy commit message verbatim, without prompting to edit it. When updating a revision, update some fields from the local commit message.' => 'Створюючи редакцію, спробуйте використати повідомлення про фіксацію робочої копії дослівно, без запиту на його редагування. Під час оновлення версії оновіть деякі поля з повідомлення локальної фіксації.',
      'LOAD STASH' => 'ЗАВАНТАЖИТИ СКЛАДКУ',
      'Put space after comment start.' => 'Поставте пробіл після початку коментаря.',
      'Deleted "%s".' => 'Видалено «%s».',
      'Failed to write file \'%s\'.' => 'Не вдалося записати файл \'%s\'.',
      'Path \'%s\' does not exist!' => 'Шлях «%s» не існує!',
      'Config: Reading system configuration file "%s"...' => 'Конфігурація: Читання файлу конфігурації системи "%s"...',
      'Continue even though reviewers are unavailable?' => 'Продовжити, навіть якщо рецензенти недоступні?',
      'Config: Reading local configuration file "%s"...' => 'Конфігурація: Читання локального файлу конфігурації "%s"...',
      'Use of `%s`' => 'Використання «%s»',
      'Unable to parse \'%s\' file \'%s\'.' => 'Неможливо проаналізувати \'%s\' файл \'%s\'.',
      'Too few arguments to %s.' => 'Замало аргументів до %s.',
      'Unknown Mercurial feature "%s".' => 'Невідома функція Mercurial "%s".',
      'This software version on the server you are connecting to is out of date and does not have support for identifying repositories by callsign or URI. Update the server sofwware to enable these features.' => 'Ця версія програмного забезпечення на сервері, до якого ви підключаєтесь,  застаріла і не підтримує ідентифікацію репозиторіїв за кодовим словом або URI. Оновіть програмне забезпечення сервера, щоб увімкнути ці функції.',
      'Line Too Long' => 'Лінія занадто довга',
      'Skip' => 'Пропустити',
      'Source code should contain only ASCII bytes with ordinal decimal values between 32 and 126 inclusive, plus linefeed. Do not use UTF-8 or other multibyte charsets.' => 'Вихідний код має містити лише байти ASCII з порядковими десятковими значеннями від 32 до 126 включно, плюс переклад рядка. Не використовуйте UTF-8 або інші мультибайтові кодування.',
      'Type' => 'Тип',
      'Toolset "%s" is unknown. The binary should be executed so that "argv[0]" identifies a supported toolset. Rename the binary or install the library that provides the desired toolset. Current available toolsets: %s.' => 'Набір інструментів "%s" невідомий. Двійковий файл повинен бути запущений так, щоб "argv[0]" ідентифіковував підтримуваний набір інструментів. Перейменуйте двійковий файл або установіть бібліотеку, яка надає бажаний набір інструментів. Поточні доступні набори інструментів: %s.',
      'PHP Syntax Error!' => 'Помилка синтаксису PHP!',
      'Configuration option ("%s") defined by extension "%s" conflicts with an existing option. Each option must have a unique key.' => 'Параметр конфігурації ("%s"), визначений розширенням "%s", конфліктує з існуючим параметром. Кожен параметр повинен мати унікальний ключ.',
      'Unable to launch an interactive text editor. Set the %s environment variable to an appropriate editor.' => 'Не вдається запустити інтерактивний текстовий редактор. Встановіть змінну середовища %s у відповідному редакторі.',
      'CoffeeLint is a style checker that helps keep CoffeeScript code clean and consistent.' => 'CoffeeLint — це засіб перевірки стилю, який допомагає підтримувати код CoffeeScript чистим і послідовним.',
      'You are trying to construct an ambiguous URI: query parameter "%s" is present in both the string argument ("%s") and the map argument.' => 'Ви намагаєтеся створити неоднозначний URI: параметр запиту "%s" присутній як у рядковому аргументі ("%s"), так і в аргументі мапи.',
      'There was an error resolving the server hostname. Check that you are connected to the internet and that DNS is correctly configured. (Did you add the domain to `%s` on some other machine, but not this one?)' => 'Виникла помилка визначення імені хоста сервера. Переконайтеся, що ви підключені до Інтернету та що правильно налаштовано DNS. (Ви додали домен до `%s` на іншому пристрої, але не на цьому?)',
      'User "%s"' => 'Користувач «%s»',
      'You are passing an integer to %s which is so large it can not be represented without loss of precision by Javascript\'s native %s class. Use %%# instead.' => 'Ви передаєте ціле число у %s, котре настільки велике, що не може бути представлене без втрати точності власним класом %s Javascript. Натомість використайте %%#.',
      'Symbol \'%s\' in production \'%s\' (\'%s\') of rule \'%s\' does not name a rule or terminal. Did you misspell a symbol, fail to specify a terminal, or forget a rule?' => 'Символ \'%s\' у виробництві \'%s\' (\'%s\')правила\'%s\' не називає правило чи термінал. Ви неправильно написали символ, не вказали термінал або забули правило?',
      'To update shell completion support for "%s", your existing "%s" file will be modified. This line will be removed:' => 'Щоб оновити підтримку завершення оболонки для "%s", ваш існуючий файл "%s" буде змінено. Цей рядок буде видалено:',
      'Class' => 'Клас',
      'Export change as a git patch. This format is more complete than unified, but less complete than arc bundles. These patches can be applied with \'%s\' or \'%s\'.' => 'Експортуйте зміни як патч git. Цей формат більш укомплектований, ніж уніфікований, але менш укомплектований, ніж пакети arc. Ці патчі можна застосувати за допомогою \'%s\' або \'%s\'.',
      'Failed to remove directory \'%s\'!' => 'Не вдалося видалити каталог «%s»!',
      'SKIP' => 'ПРОПУСТИТИ',
      'Unexpected type %s.' => 'Неочікуваний тип %s.',
      'Revision Symbol "%s"' => 'Символ перегляду «%s»',
      'The name of this file differs from the name of the class or interface it declares. Rename the file to `%s`.' => 'Ім\'я цього файлу відрізняється від імені класу або інтерфейсу, який він оголошує. Перейменуйте файл на `%s`.',
      'Deleted' => 'Видалено',
      'Some hunks could not be applied cleanly by the unix \'%s\' utility. Your working copy may be different from the revision\'s base, or you may be in the wrong subdirectory. You can export the raw patch file using \'%s\', and then try to apply it by fiddling with options to \'%s\' (particularly, %s), or manually. The output above, from \'%s\', may be helpful in figuring out what went wrong.' => 'Допоміжна функція \' %s \' unix не може ввести у використання деякі частини. Ваша робоча копія може відрізнятися від базової редакції, або ви можете бути в неправильному підкаталозі. Ви можете експортувати необроблений файл виправлення за допомогою \'%s\', а потім спробувати застосувати його, використовуючи параметри для \'%s\' (зокрема, %s ), або вручну. Наведені вище дані з \'%s\' можуть допомогти з’ясувати, що пішло не так.',
      'Associate the working copy with a specific repository. Normally, %s can figure this association out on its own, but if your setup is unusual you can use this option to tell it what the desired value is.' => 'Пов’яжіть робочу копію з певним сховищем. Зазвичай %s може визначити цей зв’язок самостійно, але якщо ваші налаштування нестандартні, ви можете скористатися цією опцією, щоб повідомити йому, яким є бажане значення.',
      'Fetch URI: %s' => 'Отримати URI: %s',
      'IP address "%s" is not properly formatted. Expected an IPv4 address like "%s", or an IPv6 address like "%s".' => 'IP-адреса "%s" неправильно відформатована. Очікується адреса IPv4, як-от "%s", або адреса IPv6, як-от "%s".',
      'In a "switch" statement, "continue;" is equivalent to "break;" but causes compile errors beginning with PHP 7.0.0.' => 'У операторі "switch" "continue"; еквівалентно "break;" але викликає помилки компіляції, починаючи з PHP 7.0.0.',
      'Copied Away' => 'Скопійовано',
      'Symbol "%s" is ambiguous: it matches multiple markers (of type "%s"). Use an unambiguous identifier.' => 'Символ "%s" неоднозначний: він відповідає декільком маркерам (типу "%s"). Використовуйте однозначний ідентифікатор.',
      'Default Parameters' => 'Параметри за замовчуванням',
      'copies' => 'копії',
      'File \'%s\' mixes function (%s) and class/interface (%s) definitions in the same file. A file which declares a class or an interface MUST declare nothing else.' => 'Файл \' %s \' поєднує визначення функції ( %s) і класу/інтерфейсу (%s) в одному файлі. Файл, який декларує клас або інтерфейс, не ПОВИНЕН декларувати нічого іншого .',
      'Configuration option ("%s") defined by extension "%s" conflicts with an alias for another option ("%s"). The key and aliases of each option must be unique.' => 'Параметр конфігурації ("%s"), визначений розширенням "%s", конфліктує з псевдонімом іншого параметра ("%s"). Ключ і псевдоніми кожного параметра мають бути унікальними.',
      'This working copy is configured to have an immutable local history, using the "history.immutable" configuration option. Amending the working copy will mutate local history.' => 'Ця робоча копія налаштована на незмінну локальну історію за допомогою параметра конфігурації "history.immutable". Внесення змін до робочої копії змінить локальну історію.',
      'The token "%s" is not formatted correctly. Valid API tokens should begin "cli-" and be 32 characters long. Make sure you visited the correct URI and copy/pasted the token correctly.' => 'Маркер " %s " відформатовано неправильно. Дійсні маркери API мають починатися з "cli-" і мати 32 символи. Переконайтеся, що ви відвідали правильний URI та правильно скопіювали/вставили маркер.',
      'You follow a wide, straight path to the north and arrive in a grove of fruit trees after a few minutes of walking. The grass underfoot is thick and small insects flit through the air.' => 'Ви підете по широкій прямій дорозі на північ і за кілька хвилин ви опинитеся у гаю фруктових дерев. Трава під ногами густа, у повітрі літають дрібні комашки.',
      'TO UPGRADE: %s' => 'ОНОВИТИ: %s',
      'Unable to find \'%s\' file to configure linters. Create an \'%s\' file in the root directory of the working copy.' => 'Не вдалося знайти файл \'%s\' для налаштування linter\'ів. Створіть файл \'%s\' у кореневому каталозі робочої копії.',
      'HTTP extension "%s" (of class "%s") returned an invalid result from "%s": expected null, or an object of class "%s".' => 'Розширення HTTP "%s" (класу "%s") повернуло недійсний результат із "%s": очікувався нуль або об’єкт класу "%s".',
      'Lists bookmarks in the working copy, annotated with additional information
    about review status.' => 'Перелічує закладки в робочій копії, анотовані додатковою інформацією
    про статус перегляду.',
      'Connecting to "%s"...' => 'Підключення до «%s»…',
      '<default>' => '<за замовчуванням>',
      'String does not require double quotes. For consistency, prefer single quotes.' => 'Рядок не вимагає подвійних лапок. Для узгодженості надавайте перевагу одинарним лапкам.',
      'Merge strategy "%s" specified in "%s" configuration is unknown. Supported merge strategies are: %s.' => 'Стратегія об’єднання "%s", указана в налаштуваннях "%s", невідома. Підтримувані стратегії злиття: %s.',
      'Continue?' => 'Продовжити?',
      'Failed to push changes to staging area. Correct the issue, or use --skip-staging to skip this step.' => 'Не вдалося внести зміни до робочої області. Виправте проблему або скористайтеся --skip-staging, щоб пропустити цей крок.',
      'Updating %s: %s' => 'Оновлення %s: %s',
      'Current Value' => 'Поточне значення',
      'Oct' => 'Жовт',
      'Enforces basic text rules like line length, character encoding, and trailing whitespace.' => 'Застосовує основні текстові правила, такі як довжина рядка, кодування символів і пробіли в кінці.',
      'Close only if the repository is untracked and the revision is accepted. Continue even if the close can\'t happen. This is a soft version of \'close-revision\' used by other workflows.' => 'Закривати, лише якщо репозиторій не відстежується і редакція прийнята. Продовжити, навіть якщо закриття не вдається. Це м’яка версія \'перегляду закриття\', яка використовується в інших робочих процесах.',
      'Object specification "%s" is unknown, expected a specification like "commit(HEAD)".' => 'Специфікація об’єкта «/"%s" невідома, очікується специфікація на кшталт "commit(HEAD)".',
      'UPDATE' => 'ОНОВЛЕННЯ',
      'Name of a concrete subclass of `%s` which enforces more granular naming convention rules for symbols.' => 'Назва конкретного підкласу `%s`, який забезпечує більш точні правила іменування символів.',
      'Convention: logical and arithmetic operators should be surrounded by whitespace.' => 'Конвенція: логічні та арифметичні оператори повинні бути оточені пробілами.',
      'The test failed, but this change is probably not what broke it. For example, it might have already been failing.' => 'Тест провалився, але, ймовірно, не ця зміна його перервала. Наприклад, він вже на той час міг мати недоліки .',
      'The `%s` syntax was not introduced until PHP 5.4, but this codebase targets an earlier version of PHP. You can rewrite this expression using `%s`.' => 'Синтаксис `%s` не був введений до PHP 5.4, але ця кодова база націлена на ранішу версію PHP. Ви можете переписати  цей вираз, використовуючи `%s`.',
      'This repository API (\'%s\') does not support the requested capability.' => 'Цей API сховища (\'%s\') не підтримує  функцію, на яку був зроблений запит.',
      '%s is broken.' => '%s зламано.',
      '"%s" class "%s" has an invalid "%s" property. Field constants must be strings and no more than %s bytes in length.' => 'Клас "%s" "%s" має недійсну властивість "%s". Константи поля мають бути рядками та мати довжину не більше, ніж %s байтів.',
      'GENERATE' => 'Згенерувати',
      'Unknown Command' => 'Невідома команда',
      '**upload** [__options__] -- __file__ [__file__ ...]' => '**завантажити** [__options__] -- __file__ [__file__ ...]',
      'The SSL CA Bundles that we tried to use could not be read or are not formatted correctly.' => 'Пакети SSL CA, які ми намагалися використати, не вдалося прочитати або вони неправильно відформатовані.',
      'DATA' => 'ДАНІ',
      'Uploaded "%s".' => 'Завантаження «%s».',
      'No revision specified with "--revision", and no revisions found that match the current working copy state. Use "--revision <id>" to specify which revision you want to amend.' => 'Жодна ревізія не вказана за допомогою "--revision", і не знайдено ні одної ревізії, яка відповідає поточному стану робочої копії. Використайте "--revision <id>", щоб вказати, яку версію ви хочете змінити.',
      '---' => '---',
      'The "merge" strategy generates a merge commit when publishing that retains local checkpoint commits (but produces a nonlinear published history). Select this strategy if you do not want "arc land" to discard checkpoint commits.' => 'Стратегія "злиття" генерує фіксацію злиття під час публікації, яка зберігає локальні фіксації контрольних точок (але створює нелінійну історію публікацій). Виберіть цю стратегію, якщо ви не хочете, щоб "arc land" скасовував фіксації контрольних точок.',
      'When running noninteractively, you MUST provide "--" to all commands (even if they take no arguments).' => 'Під час неінтерактивного запуску ви ПОВИННІ надати "--" всім командам (навіть якщо вони не приймають аргументів).',
      'Contents Modified' => 'Зміст змінено',
      '%s currently supports only one file attachment for each parameter name. You are trying to attach two different files with the same parameter, "%s".' => '%s наразі підтримує вкладення лише одного файлу для кожного імені параметра. Ви намагаєтеся додати два різні файли з однаковим параметром "%s".',
      'Arguments "--into-local", "--into-remote", and "--into-empty" are mutually exclusive.' => 'Аргументи "--into-local", "--into-remote" і "--into-empty" є взаємовиключними.',
      'Execution of "git cat-file --batch-check" emitted an unexpected number of lines, expected %s but got %s.' => 'Виконання "git cat-file --batch-check" видало неочікувану кількість рядків, очікувалося %s, але отримано %s.',
      'Classes should extend from `%s` or from some other class. All classes (except for `%s` itself) should have a base class.' => 'Класи повинні розширюватися від `%s` або від будь-якого іншого класу. Всі класи (окрім самого `%s`) повинні мати базовий клас.',
      'Argument Error' => 'Помилка аргументу',
      'Export change as a unified patch. This format is less complete than git patches or arc bundles. These patches can be applied with \'%s\' or \'%s\'.' => 'Експортуйте зміну як уніфікований патч. Цей формат менш укомплектований, ніж git patches або arc bundles. Ці патчі можна застосувати за допомогою \'%s\' або \'%s\'.',
      'Name files using only letters, numbers, period, hyphen and underscore.' => 'Найменовуйте файли, використовуючи лише літери, цифри, крапку, дефіс і підкреслення.',
      'it is the first ancestor of %s that has a diff and is the gca or a descendant of the gca with \'%s\', specified by \'%s\' in your %s \'base\' configuration.' => 'це перший предок %s, який має різницю та є gca або нащадком gca з \'%s\', визначеним \'%s\' у вашій конфігурації %s \'base\'.',
      'The configuration key "%s" is not recognized by arc. It may be misspelled or out of date.' => 'Ключ конфігурації "%s" не розпізнається arc. Можливо, він написаний з помилкою або застарілий.',
      'Server URI "%s" must include a protocol and domain. It should be in the form "%s".' => 'URI сервера "%s" має включати протокол і домен. Він має бути у стилі "%s".',
      'Specify a string (or list of strings) identifying the interpreter which should be used to invoke the linter binary. If you provide a list of possible interpreters, the first one that exists will be used.' => 'Вкажіть рядок (або список рядків), що ідентифікує інтерпретатор, який слід використовувати для виклику двійкового файлу linter. Якщо ви надасте список можливих інтерпретаторів, буде використано перший із наявних.',
      'No repositories matched the query. Check that your configuration is correct, or use "%s" to select a repository explicitly.' => 'Жодне сховище не відповідає запиту. Переконайтеся, що ваші налаштування правильні, або використовуйте "%s", щоб вибрати конкретне сховище.',
      'File \'%s\' declares more than one class or interface (%s). A file which declares a class or interface MUST declare nothing else.' => 'Файл \'%s\' оголошує більше, ніж один клас або інтерфейс (%s). Файл, який оголошує клас або інтерфейс, НЕ ПОВИНЕН оголошувати ще щось інше.',
      'NEW LIBRARY' => 'НОВА БІБЛІОТЕКА',
      'Downloading "%s" (%s byte(s)) to "%s"...' => 'Завантаження «%s» (%s байтів) на «%s»…',
