    або закладку.
    Коли "arc work" створює гілку або закладку, вона використовуватиме **--start** як точку філії, якщо вона надається. В іншому випадку поточний стан робочої копії буде слугувати початковою точкою.',
      'This codebase targets PHP %s, but short ternary was not introduced until PHP 5.3.' => 'Ця кодова база орієнтований на PHP %s, але анонімні функції не було запроваджено раніше, ніж у PHP 5.3.',
