              якщо __name__ надано,  linter з таким іменем буде відображено.',
      'Prompt ("%s") is executing, but it is not properly bound to the invoking workflow. You may have called "newPrompt()" to execute a prompt instead of "getPrompt()". Use "newPrompt()" when defining prompts and "getPrompt()" when executing them.' => 'Підказка (" %s ") виконується, але вона неправильно прив’язана до робочого процесу виклику. Можливо, ви викликали "newPrompt()", щоб виконати підказку замість "getPrompt()". Використовуйте "newPrompt()" під час визначення підказок і "getPrompt()" під час їх виконання.',
      'BROKEN' => 'ЗЛАМАНО',
      'You\'re running a command which operates on a range of revisions (usually, from some revision to HEAD) but have not specified the revision that should determine the start of the range.
    Previously, arc assumed you meant \'%s\' when you did not specify a start revision, but this behavior does not make much sense in most workflows outside of Facebook\'s historic %s workflow.
    arc no longer assumes \'%s\'. You must specify a relative commit explicitly when you invoke a command (e.g., `%s`, not just `%s`) or select a default for this working copy.
    In most cases, the best default is \'%s\'. You can also select \'%s\' to preserve the old behavior, or some other remote or branch. But you almost certainly want to select \'origin/master\'.
    (Technically: the merge-base of the selected revision and HEAD is used to determine the start of the commit range.)' => 'Ви виконуєте команду, яка працює з діапазоном версій (зазвичай, від деякої версії до HEAD), але не вказали версію, яка має визначати початок діапазону.
    Раніше arc припускав, що ви мали на увазі \' %s \', коли ви не вказали початкову версію, але така поведінка не має особливого значення в більшості робочих процесів за межами історичного робочого процесу Facebook %s .
    arc більше не передбачає \' %s \'. Ви повинні вказати відносну фіксацію явно, коли ви викликаєте команду (наприклад, ` %s `, а не тільки ` %s `) або вибрати значення за замовчуванням для цієї робочої копії.
    У більшості випадків найкращим за замовчуванням є \' %s \'. Ви також можете вибрати \'%s\', щоб зберегти стару поведінку, або будь-який інший віддалений або споріднений. Але ви майже напевно захочете вибрати \'origin/master\'.
    (Технічно: база злиття вибраної версії та HEAD використовується, щоб визначити початок діапазону фіксації.)',
