      'Unable to locate interpreter "%s" to run linter %s. You may need to install the interpreter, or adjust your linter configuration.' => 'Неможливо знайти перекладач "%s" для запуску linter %s . Можливо, вам доведеться встановити перекладач або налаштувати конфігурацію лінтера.',
