      'Learn More:' => 'Дізнатися більше:',
      'Command (of class "%s") was constructed with a "PhutilCommandString", but also passed arguments. When using a prebuilt command, you must not pass arguments.' => 'Команда (класу "%s") була створена за допомогою "PhutilCommandString", але також передавала аргументи. Не можна передавати аргументи, використовуючи попередньо побудовану команду.',
      'Multiple repostories (%s) matched the query. You can use the "%s" configuration to select the one you want.' => 'Кілька сховищ (%s) відповідають запиту. Ви можете скористатися конфігурацією "%s", щоб вибрати такий, який захочете.',
      'File "%s"' => 'Файл «%s»',
      'You have incompletely checked out directories in this working copy. Fix them before proceeding.\'' => 'Ви не повністю перевірили каталоги в цій робочій копії. Виправте їх, перш ніж продовжити.\'',
      'pep8 is a tool to check your Python code against some of the style conventions in PEP 8.' => 'pep8 — це інструмент для перевірки вашого коду Python на відповідність деяким стилям у PEP 8.',
      'Advice' => 'Порада',
      'The remote host refused the connection. This usually means the host is not running an HTTP server, or the network is blocking connections from this machine. Verify you can connect to the remote host from this host.' => 'Віддалений хост відмовив у підключенні. Зазвичай це означає, що хтось не запустив HTTP-сервер або мережа блокує з’єднання з цього пристрою. Переконайтеся, що ви можете підключитися до віддаленого хоста з цього хоста.',
      'Expected type \'%s\', got type \'%s\'.' => 'Очікуваний тип «%s», отриманий тип «%s».',
      'You can not reiterate over a %s object. The entire goal of the construct is to avoid keeping output in memory. What you are attempting to do is silly and doesn\'t make any sense.' => 'Ви не можете повторювати об’єкт %s . Загальна мета конструкції полягає в тому, щоб уникнути збереження виведення в пам’яті. Те, що ви намагаєтеся  зробити, безглуздо і не має сенсу.',
      'It is early morning. Glimses of sunlight peek through the trees and you hear the faint sound of birds overhead.' => 'Ранній ранок. Відблиски сонячного світла проглядають крізь дерева, і ви чуєте слабкий голос птахів над головою.',
      'List Assignment' => 'Призначення списку',
      'LOAD ERROR' => 'ПОМИЛКА ЗАВАНТАЖЕННЯ',
      'Argument to "phutil_microseconds_since(...)" should be a value returned from "microtime(true)".' => 'Аргумент "phutil_microseconds_since(...)" має бути значенням, що повертається з "microtime(true)".',
      'Normally, if a patch has dependencies that are not present in the working copy, arc tries to apply them as well. This flag prevents such work.' => 'Зазвичай, якщо патч має залежні об\'єкти, яких немає в робочій копії, arc також намагається застосувати їх. Цей прапорець запобігає такій роботі.',
      'Library "%s" (in "%s") is on branch "%s", but this branch is not supported for automatic upgrades. Supported branches are: %s.' => 'Бібліотека "%s" (у "%s") знаходиться у відгалуженні "%s", але ця відгалуження не підтримує автоматичне оновлення. Підтримувані відгалуження: %s.',
      'Priority' => 'Пріоритет',
      'Unable to write configuration: there is no writable configuration source in the "%s" scope.' => 'Неможливо записати конфігурацію: немає джерела конфігурації, доступного для запису, в області "%s".',
      'Closed' => 'Закрито',
      'To go back to how things were before you ran "arc land", run these %s command(s):' => 'Щоб повернутися до того, як все було до того, як ви запустили "arc land", виконайте ці команди %s :',
      'ID' => 'ID',
      'This loop reuses iterator variables (%s) from an outer loop. You might be clobbering the outer iterator. Change the inner loop to use a different iterator name.' => 'Цей цикл повторно використовує змінні перекладача (%s) із зовнішнього циклу. Можливо, ви збиваєте зовнішній перекладач. Змініть внутрішній цикл, щоб використовувати іншу назву перекладача.',
      'Failed to remove file \'%s\'!' => 'Не вдалося вилучити файл «%s»!',
      'To configure Git to ignore certain files in this working copy, add the file paths to "%s".' => 'Щоб налаштувати Git на ігнорування певних файлів у цій робочій копії, додайте шляхи до файлів до "%s".',
      'Unable to locate script "%s" to run linter %s. You may need to install the script, or adjust your linter configuration.' => 'Не вдалося знайти сценарій "%s" для запуску linter\'a %s . Можливо, вам знадобиться встановити сценарій або налаштувати вашу конфігурацію linter.',
      'Parse Error' => 'Помилка аналізу',
      'Upload files.' => 'Завантажте файли.',
      'The "onto" refs you have selected are connected to multiple different remotes via Git branch upstreams. Use "--onto-remote" to select a single remote.' => 'Вибрані вами посилання "onto" підключаються до кількох різних дистанційних пристроїв через висхідну гілку Git. Використовуйте "--onto-remote", щоб вибрати один пульт.',
      'Name Error' => 'Назва помилки',
      '...and the current working copy state will be sent to Differential, because %s' => '...і поточний стан робочої копії буде надіслано до Differential, оскільки %s',
      'Duplicate Symbol' => 'Дублікат символу',
      'Provide a map from lint codes to adjusted severity levels: error, warning, advice, autofix or disabled.' => 'Надайте карту від кодів lint до налаштованих рівнів серйозності: помилка, попередження, порада, автовиправлення або вимкнено.',
      'Extension ("%s") defines invalid alias ("%s") for configuration key ("%s"). Configuration keys and aliases: may only contain lowercase letters, numbers, hyphens, underscores, and periods; must start with a letter; and must be at least three characters long.' => 'Розширення ("%s") визначає недійсний псевдонім ("%s") для ключа конфігурації ("%s"). Ключі конфігурацій та псевдонімів: можуть містити лише малі літери, цифри, дефіси, підкреслення та крапки; має починатися з літери; і має містити щонайменше три символи.',
      'Connection could not be initiated. This usually indicates a DNS problem: verify the domain name is correct, that you can perform a DNS lookup for it from this machine. (Did you add the domain to `%s` on some other machine, but not this one?) This might also indicate that you specified the wrong port.' => 'Не вдалося встановити з’єднання. Зазвичай це вказує на проблему з DNS: переконайтеся, що ім’я домену правильне, чи можна виконати його пошук у DNS із цієї машини. (Ви додали домен до `%s` на іншому пристрої, проте не на цьому?) Це також може означати, що ви вказали неправильний порт.',
      'When landing multiple revisions at once, push and rebase after each merge completes instead of waiting until all merges are completed to push.' => 'Під час отримання кількох версій одночасно, надсилайте і перебазовуйте після завершення кожного злиття, а не чекайте, поки всі злиття завершаться, щоб надіслати.',
      'HEAD has been amended with \'Differential Revision:\', as specified by \'%s\' in your %s \'base\' configuration.' => 'HEAD було змінено на \'Differential
     Revision:\', як зазначено "%s" у вашій  конфігурації \'base\' %s.',
      'The "execute()" method of "PhutilExecPassthru" is deprecated and calls should be replaced with "resolve()". See T13660.' => 'Метод "execute()" у "PhutilExecPassthru" застарів, і виклики слід замінити на "resolve()". Див. T13660.',
      'Peforce remote "%s" was selected because the existence of this remote implies this working copy was synchronized from a Perforce repository.' => 'Вибрано пульт керування Peforce "%s", оскільки існування цього віддаленого пристрою означає, що цю робочу копію було синхронізовано зі сховища Perforce.',
      'Failed to push lfs changes to staging area. Correct the issue, or use --skip-staging to skip this step.' => 'Не вдалося надіслати зміни lfs до робочої області. Виправте проблему або скористайтеся --skip-staging, щоб пропустити цей крок.',
      'RULES' => 'ПРАВИЛА',
      'There was an error verifying the SSL Certificate Authority while negotiating the SSL connection. This usually indicates that you are using a self-signed certificate but have not added your CA to the CA bundle. See instructions in "%s".' => 'Під час узгодження з’єднання SSL сталася помилка під час перевірки Центру Сертифікації SSL. Зазвичай це вказує на те, що ви використовуєте власноруч підписаний сертифікат, але не додали свій ЦС до пакету ЦС. Дивіться інструкції в "%s".',
      'To install shell completion support for "%s", a new "%s" file will be created with this content:' => 'Щоб установити підтримку завершення оболонки для %s", буде створено новий файл "%s" із таким вмістом:',
      'The diff or revision you specified is either invalid or you don\'t have permission to view it.' => 'Вказана вами різниця або версія або недійсна, або у Вас немає дозволу на її перегляд.',
      'Writing %s...' => 'Написання %s…',
      'You are installing a standard API token, but a CLI API token was expected. If you\'re writing a script, consider passing the token at runtime with --conduit-token instead of installing it.' => 'Ви встановлюєте стандартний маркер API, але очікувався маркер CLI API. Якщо ви пишете сценарій, спробуйте передати маркер під час виконання за допомогою --conduit-token замість того, щоб його встановити.',
      'Multiple supported shells were detected. Unable to determine which shell to install autocompletion rules for. Use "--shell" to select a shell.' => 'Було виявлено кілька підтримуваних оболонок. Не вдалося визначити, для якої оболонки встановити правила автозавершення. Використайте "--shell", щоб вибрати оболонку.',
      'Revision %s, %s' => 'Перегляд %s, %s',
      'You don\'t own revision %s: "%s". Normally, you should only update revisions you own. You can "Commandeer" this revision from the web interface if you want to become the owner.
    Update this revision anyway?' => 'Ви не володієте версією %s : "%s". Зазвичай вам слід оновлювати лише версії, якими ви володієте. Ви можете використати функцію "Commandeer"  до цієї версії з веб-інтерфейсу, якщо хочете стати власником.
    Оновити цю версію все одно?',
      'French (France)' => 'Французька (Франція)',
      'Included changes:' => 'Включені зміни:',
      'This configuration option ("%s") does not support runtime definition with "--config".' => 'Цей параметр налаштувань (" %s ") не підтримує визначення часу виконання за допомогою "--config".',
      'You have a saved revision message in \'%s\'.
    %sYou can use this message, or discard it.' => 'У вас є збережене повідомлення версії в \'%s\'.
    %sВи можете використати це повідомлення або відкинути його.',
      'Selected "onto" ref "%s" is invalid: the empty string is not a valid ref.' => 'Вибране посилання "onto" "%s" недійсне: порожній рядок не є дійсним посиланням.',
      '%s %s -> %s %s %s' => '%s %s -> %s %s %s',
      'Common causes are:
      - Your copy of %s is out of date.
        This is the most common cause.
        Update this copy of %s:
          %s
      - Some other library is out of date.
        Update the library this symbol appears in.
      - The symbol is misspelled.
        Spell the symbol name correctly.
      - You added the symbol recently, but have not updated
        the symbol map for the library.
        Run "arc liberate" in the library where the symbol is
        defined.
      - This symbol is defined in an external library.
        Use "@phutil-external-symbol" to annotate it.
        Use "grep" to find examples of usage.' => 'Поширені причини:
     - Ваша копія %s застаріла.
       Це найпоширеніша причина.
       Оновіть дану копію %s:
       %s 
     - Якась інша бібліотека застаріла.
       Оновіть бібліотеку, у якій 
       з’являється цей символ.
     - Символ написаний з помилкою.
     Напишіть назву символу правильно.
     - Ви нещодавно додали символ, але не 
    оновлювали
       карту символів для бібліотеки.
       Запустіть "arc liberate" у бібліотеці, де символ
     визначено.
     - Цей символ визначено у зовнішній бібліотеці.
       Використайте "@phutil-external-symbol", щоб зробити примітку про це.
       Використайте "grep", щоб знайти приклади використання.',
      'The revision associated with commit "%s" (an ancestor of: %s) is ambiguous. These %s revision(s) are associated with the commit:' => 'Версія, пов’язана з фіксацією "%s" (є попередницею: %s), є неоднозначною. Ці %s версії пов’язані з фіксацією:',
      'See <%s>. The default merge strategy under Git with "history.immutable" has changed from "merge" to "squash". Your configuration is ambiguous under this behavioral change. (Use "--strategy" or configure "arc.land.strategy" to bypass this check.)' => 'Див. <%s>. Стандартну стратегію злиття в Git із "history.immutable" змінено з "merge" на "squash". Ваша конфігурація є неоднозначною після цієї зміни. (Використайте "--strategy" або налаштуйте "arc.land.strategy", щоб пройти цю перевірку.)',
      'Unknown diff type.' => 'Невідомий тип різниці.',
      '"arc amend" is only supported under Mercurial 2.2 or newer. Older versions of Mercurial do not support the "--amend" flag to "hg commit ...", which this workflow requires.' => '"arc amend" підтримується лише в Mercurial 2.2 або новіших версіях. Старіші версії Mercurial не підтримують прапорець "-amend" для "hg commit ...", якого вимагає цей робочий процес.',
      'Since exactly one revision in Differential matches this working copy, it will be **updated** if you run \'%s\'.' => 'Оскільки ті одна версія в Differential відповідає цій робочій копії, її буде **оновлено**, якщо ви запустите \'%s\'.',
      'Merge strategy "%s" specified with "--strategy" is unknown. Supported merge strategies are: %s.' => 'Стратегія злиття "%s", указана за допомогою "--strategy", невідома.  Стратегії злиття, що підтримуються: %s.',
      'it is the merge-base of the upstream of the current branch and HEAD, and matched the rule \'%s\' in your %s \'base\' configuration.' => 'це база злиття верхнього потоку поточної гілки та HEAD, і вона відповідає правилу \'%s\' у вашій конфігурації \'base\' %s .',
      'LOAD' => 'ЗАВАНТАЖИТИ',
      'TODO: You are forcing a revision, but commits are associated with some other revision. Are you REALLY sure you want to land ALL these commits with a different unrelated revision???' => 'ЗАВДАННЯ: ви примусово виконуєте перегляд, але здійснення пов’язані з деякими іншими переглядами. Ви ДІЙСНО впевнені, що хочете отримати ВСІ ці здійснення з іншою непов’язаною версією???',
      'Expected a hunk header, like \'%s\' (svn), \'%s\' (svn properties), \'%s\' (git show), \'%s\' (git diff), \'%s\' (unified diff), or \'%s\' (hg diff or patch).' => 'Очікувався заголовок частини, наприклад "%s" (svn), "%s" (властивості svn),"%s" (git show),"%s" (git diff), "%s" (уніфікована різниця) або "%s" ( hg diff або patch).',
      'Dec' => 'Груд',
      'Resolve these errors:' => 'Вирішіть ці помилки:',
      'Instead of creating or updating a revision, only create a diff, which you may later attach to a revision.' => 'Замість створення чи оновлення версії лише створіть diff, який ви можете пізніше прикріпити до версії.',
      'Request specifies two values for key "%s", but parameter names must be unique if you are posting file data due to limitations with cURL.' => 'У запиті вказано два значення для ключа "%s", проте імена параметрів мають бути унікальними, якщо ви публікуєте дані файлу згідно з обмеженнями cURL.',
      'No lint engine is configured for this project. Create an \'%s\' file, or configure an advanced engine with \'%s\' in \'%s\'.' => 'Для цього проекту не налаштовано механізм lint. Створіть файл "%s" або налаштуйте розширений механізм із "%s" у "%s".',
      'Attempting to make an HTTP request which includes file data, but the value of a query parameter begins with "%s". PHP interprets these values to mean that it should read arbitrary files off disk and transmit them to remote servers. Declining to make this request.' => 'Спроба зробити запит HTTP, який містить дані файлу, але значення параметра запиту починається з "%s". PHP інтерпретує ці значення так, що він повинен читати довільні файли з диска та передавати їх на віддалені сервери. Відмова у виконанні цього запиту.',
      'HOLD CHANGES' => 'УТРИМУВАТИ ЗМІНИ',
      'The cURL library raised an error while making a request. You may be able to find more information about this error (error code: %d) on the cURL site: %s' => 'Бібліотека cURL викликала помилку під час виконання запиту. Ви можете знайти більше інформації про цю помилку (код помилки: %s) на сайті cURL: %s',
      'P4 MODE' => 'РЕЖИМ P4',
      'This variable was used already as a by-reference iterator variable. Such variables survive outside the `%s` loop, do not reuse.' => 'Ця змінна вже використовувалася як змінна ітератора за посиланням. Такі змінні зберігаються поза циклом `%s`, але не використовуються повторно.',
      'German (Germany)' => 'Німецька (Німеччина)',
      'A list of paths to phutil libraries that should be loaded at startup. This can be used to make classes available, like lint or unit test engines.' => 'Список шляхів до бібліотек phutil, які повинні бути завантажені під час запуску. Їх можна використовувати, щоб зробити доступними класи, як-от знаряддя lint або unit test.',
      'INFO' => 'ІНФОРМАЦІЯ',
      'You are using "--hold", so execution will stop before the %s branche(s) are actually created. You will be given instructions to create the branches.' => 'Ви використовуєте "--hold", тому виконання буде зупинено до того, як буде створено гілку(-и) %s. Ви отримаєте інструкції щодо створення гілок.',
      'Unknown conversion %s.' => 'Невідома конвертація %s.',
      '<none>' => '<жоден>',
      'The flags "--generate" and "--shell" are mutually exclusive. The "--shell" flag selects which shell to install support for, but the "--generate" suppresses installation.' => 'Прапори "--generate" і "--shell" є взаємовиключними. Прапорець "--shell" вибирає, для якої оболонки встановити підтримку, але "--generate" блокує встановлення.',
      'Call to "assertCaught(<junk>, ...)" for test case "%s" passed bad expected value. Expected bool, class name as a string, or a list of class names. Got: %s.' => 'Виклик "assertCaught (<junk> , ...)" для тестового прикладу "%s" передано неправильне очікуване значення. Очікується логічне значення, ім\'я класу як рядок або список імен класів. Отримано: %s.',
      'The format of user symbol "%s" is unrecognized. Expected a username like "alice" or "@alice", or a user PHID, or a user ID, or a special function like "viewer()".' => 'Формат символу користувача "%s" не розпізнається. Очікувалося ім’я користувача, як-от "alice" або "@alice", або PHID користувача, або ідентифікатор користувача, або спеціальна функція, як-от "viewer()".',
      'Failed to connect to server (%s): %s' => 'Не вдалося підключитися до сервера (%s): %s',
      'When specifying AWS credentials with --access-key and --secret-key, you must provide both keys.' => 'Указуючи облікові дані AWS за допомогою --access-key і --secret-key, ви повинні надати обидва ключі.',
      'CHOOSE' => 'ВИБРАТИ',
      'Night has fallen, but your surroundings are illuminated by the silvery glow of a full moon overhead. The night is cool and the air is crisp. The trees are calm.' => 'Настала ніч, але те, що вас оточує, освітлюється сріблястим сяйвом повного місяця над головою. Ніч прохолодна, повітря чисте. Дерева спокійні.',
      'Your stored credentials for the server you are trying to connect to ("%s") are not valid.' => 'Ваші збережені облікові дані для сервера, до якого ви намагаєтесь підключитися ("%s"), є недійсними.',
      'The `%s` function should be avoided. It is potentially unsafe and makes debugging more difficult.' => 'Слід уникати функції `%s`. Вона потенційно небезпечна та ускладнює усунення несправностей.',
